import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => (
  <nav className="navbar">
    <h1>Task Tracker</h1>
    <ul>
      <li><Link to="/">Dashboard</Link></li>
      <li><Link to="/add-task">Add Task</Link></li>
    </ul>
  </nav>
);

export default Navbar;
